total_demand_yearly["demand"] = 0 

for i in range(len(total_demand_yearly)):

    for j in range(int(2021- total_demand_yearly.iloc[i].year)+1):

        number_of_years = 2021 - int(total_demand_yearly.iloc[i].year)+1

        amount = total_demand_yearly.iloc[i].number_of_sold_items


        total_demand_yearly.at[j+i, "demand"] += int(amount/number_of_years)

total_supply_yearly["supply"] = 0 

for i in range(len(total_supply_yearly)):

    for j in range(int(2021- total_supply_yearly.iloc[i].year)+1):

        number_of_years = 2021 - int(total_supply_yearly.iloc[i].year)+1

        amount = total_supply_yearly.iloc[i].number_of_listed_items


        total_supply_yearly.at[j+i, "supply"] += int(amount/number_of_years)
